INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Nexo Byte', '', '-', '-', '-', 'Quito', 'admin@int', '-', 'Corp.', 'Condado', 'N76', '2024', 'Ecuador', '0959491061', 'Nexo Byte fue fundada en 2024 con el objetivo de ayudar a las empresas a resolver sus problemas y optimizar sus procesos tecnológicos mediante el uso de software de alta calidad. Desde el principio, nuestro enfoque ha sido mejorar el rendimiento empresarial a través de la aplicación eficiente de soluciones tecnológicas, adaptadas a las necesidades específicas de cada cliente. Con el compromiso de brindar un servicio óptimo, nuestra empresa se ha posicionado como un aliado estratégico para empresas que buscan optimizar sus operaciones mediante la tecnología.<br>', , '<p>En Nexo Byte, ofrecemos una amplia gama de servicios tecnológicos diseñados para satisfacer las necesidades únicas de cada cliente:</p><ul><li><strong>Desarrollo de Software personalizado:</strong> Creamos soluciones de software a medida para escritorio, web y móvil, adaptadas a las necesidades específicas de cada empresa.</li><li><strong>Cableado estructurado y servicios de redes LAN:</strong> Implementamos infraestructuras de red seguras y eficientes para mejorar la conectividad empresarial.</li><li><strong>Mantenimiento de equipos tecnológicos:</strong> Ofrecemos servicios completos de mantenimiento preventivo y correctivo para equipos tecnológicos.</li><li><strong>Consultoría en tecnología empresarial:</strong> Ayudamos a las empresas a definir e implementar estrategias tecnológicas que mejoren su rendimiento.</li></ul><p>Nuestro servicio principal se destaca en la <strong>creación de páginas web</strong> y la <strong>automatización de procesos manuales</strong>, brindando soluciones personalizadas que mejoran la eficiencia y productividad de nuestros clientes.</p>', '<p>Con <strong>2 años de experiencia</strong> en el desarrollo de software, hemos trabajado con clientes del sector gubernamental, como el <strong>Comando Conjunto de las Fuerzas Armadas</strong> y el <strong>Municipio de Cayambe</strong> en Ecuador, ayudándolos a implementar soluciones tecnológicas que mejoran su gestión y rendimiento. Aunque atendemos a empresas de diversos sectores, nos especializamos en el trabajo con entidades gubernamentales, ofreciendo soluciones tecnológicas que optimizan procesos críticos.</p><p>Nos mantenemos a la vanguardia de la industria a través de <strong>proyectos de investigación continua</strong>, lo que nos permite ofrecer a nuestros clientes las últimas innovaciones y tendencias en el ámbito tecnológico.</p>', '1-10', '10-11-2024 10:11 PM [EAT +03:00]', 'employer', 'www.NexoByte', '2f736f83b3abbe013fef14e8029f2788', 'CM835956647');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Omar Alexander', 'Sani', 'Male', '01', '01', '2024', 'omarxdj4@gmail.com', 'Tercer Nivel', 'Desarrollador De Software', 'Quito', 'Condado', '2024', 'Ecuador', '0963285407', '<i></i><b></b><b><br><br>Ingeniero en Tecnologías Informáticas | Ingeniero en Desarrollo de Software | </b><small></small><b> Seguridad Informática<br></b><br>Soy Profesional en <b></b>Desarrollo de Software orientado a Seguridad Informática y experiencia en gestión de proyectos tecnológicos.<br><br>He liderado proyectos innovadores como <b>SPG-CT Cayambe y EmpleaTec</b>, una plataforma de empleo para el Instituto Nelson Torres, que conecta talento con oportunidades a través de tecnología accesible. Mi capacidad para liderar equipos multidisciplinarios y ejecutar estrategias tecnológicas ha sido clave para el éxito de estos proyectos.<br><b><br>Habilidades clave:</b><ul><li>-Conocimineto en Tecnologias como Java, Vue, Angular, Typscript, Web, Docker, C#, .Net ,Mysql MongoDb</li><li>- Diseño e implementación de arquitecturas de microservicios y aplicaciones escalables.</li><li>- Gestión de proyectos tecnológicos y liderazgo de equipos.</li><li>- Comunicación efectiva y habilidades de liderazgo.</li><li>- Conocimientos avanzados en redes y cableado estructurado.</li><li>- Administración de infraestructuras tecnológicas para el Comando Conjunto de las Fuerzas Armadas del Ecuador.</li></ul><p><b></b></p>', , NULL, NULL, '-', '11-11-2024 05:11 AM [EAT +03:00]', 'employee', '-', 'dee7ffed5dc99035bb13968778cbc825', 'EM073265743');
